    return (
        
        
        <div className='card2 col-md-4'>
            <Tilt className="Tilt" options={{ max: 25, speed: 300, scale:1 }}>
                    <div className='content box Tilt-inner'>
                        <h4>{name}</h4>
                        <img className='card-img singleImage' src={image} alt='card'/>
                    </div>
            </Tilt>
        </div>
        
        
            
        
